import React from 'react';
import { MenuItemLink, WithPermissions } from 'react-admin';
import PeopleIcon from '@material-ui/icons/People';
import UserIcon from '@material-ui/icons/Person';

import PostIcon from '@material-ui/icons/Book';
import ActivityIcon from '@material-ui/icons/LocalActivity';
import CategoryIcon from '@material-ui/icons/Collections';
import HomeIcon from '@material-ui/icons/Home';
import EventIcon from '@material-ui/icons/EventNote';
const Menu = ({ resources, onMenuClick, logout }) => (
  <div>
    <MenuItemLink
      to="/"
      primaryText="Dashboard"
      leftIcon={<HomeIcon />}
      onClick={onMenuClick}
    />
    <WithPermissions
      render={({ permissions }) =>
        permissions === 'Petiano' || permissions === 'admin'
          ? [
              <MenuItemLink
                to="/Categoria"
                primaryText="Categoria"
                leftIcon={<CategoryIcon />}
                onClick={onMenuClick}
              />,

              <MenuItemLink
                to="/Eventos"
                primaryText="Evento"
                leftIcon={<EventIcon />}
                onClick={onMenuClick}
              />,
              <MenuItemLink
                to="/Postagens"
                primaryText="Postagem"
                leftIcon={<PostIcon />}
                onClick={onMenuClick}
              />,
              <MenuItemLink
                to="/Usuarios"
                primaryText="Usuario"
                leftIcon={<PeopleIcon />}
                onClick={onMenuClick}
              />
            ]
          : null
      }
    />
    <WithPermissions
      render={({ permissions }) =>
        permissions === 'Ajudante'
          ? [
              <MenuItemLink
                to="/Ajudantes"
                primaryText="Ajudante"
                leftIcon={<UserIcon />}
                onClick={onMenuClick}
              />
            ]
          : null
      }
    />
  </div>
);

export default Menu;
